INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "フリーマーケット会場", 1, 7, 8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, "ペコリーヌとの出会い", "青空の下で謁見", 2, 2834, 40, 0, 10118, 5118061);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "フリーマーケット会場", 1, 7, 8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, "マホとの出会い", "未来の騎空団\nマスコット？", 2, 2835, 40, 0, 10118, 5118062);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "ランドソル市街地", 1, 7, 8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, "アキノとの出会い", "お嬢さまからの\n緊急依頼", 2, 2837, 40, 0, 10118, 5118063);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "フリーマーケット会場", 1, 18, 8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, "ジュンとの出会い", "黄金色の悩みごと", 2, 4108402, 40, 0, 10118, 5118064);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "フリーマーケット会場", 1, 18, 8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, "カオリとの出会い", "白熱！　格闘大会！", 2, 4107402, 40, 0, 10118, 5118065);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, "オーエド町", 1, 16, 8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, "ニノンとの出会い", "祭り太鼓はオーエドの華", 2, 9000227, 40, 0, 10118, 5118066);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "フリーマーケット会場", 1, 19, 8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, "スズナとの出会い", "人気者は遅れて\nやってくる", 3, 2101181, 40, 0, 10118, 5118067);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "ランドソル市街地", 1, 18, 8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, "ナナカとの出会い", "巫女・ミーツ・魔法少女", 3, 4109402, 40, 0, 10118, 5118068);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "フリーマーケット会場", 1, 18, 8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", 3, 4305402, 40, 0, 10118, 5118069);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "ランドソル市街地", 1, 18, 8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, "ユカリとの出会い", "この出会いにカンパイ！", 3, 4101402, 40, 0, 10118, 5118070);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, "ランドソル市街地", 1, 18, 8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, "アオイとの出会い", "陰陽アンサンブル", 3, 4106402, 40, 0, 10118, 5118071);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, "フリーマーケット会場", 1, 7, 8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, "シノブとの出会い", "運試し十番勝負！", 3, 2836, 40, 0, 10118, 5118072);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 0, 0, 0, 0, 0, 0, "オープニング", "彼女たちの新たな日常", 1, 0, 0, 10145115, 10118, 5118600);
